import React from 'react'

const CheckBox = props => {
	return (
		<div className="form-group">
      <label className="checkbox-inline">
        <input type="checkbox" id="inlineCheckbox" value="option"/> I am a human
      </label>
    </div>
		)
}

export default CheckBox;
